import React from "react";
import styled from "styled-components";

const BodyContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const ImageSliderContainer = styled.section`
  height: 80vh;
  overflow: hidden;
  .temp-main {
    width: 100%;
  }
`;

const StepsContainer = styled.section``;

const Body = () => {
  return (
    <BodyContainer>
      <ImageSliderContainer>
        <img className="temp-main" src="images/temp_main.jpg" />
      </ImageSliderContainer>
      <section className="steps-container">
        <article className="steps step1"></article>
        <article className="steps step2">색깔3</article>
        <article className="steps step3">색깔5</article>
        <article className="steps step4">색깔6</article>
      </section>
    </BodyContainer>
  );
};

export default Body;
